import { View, Button, StyleSheet, Image } from "react-native";
import React from 'react';

const HomeScreen = ({ navigation }) => {
    return (
        <View style={styles.container}>
            <Image source={require('./BMI/assets/logo.png')} />



            <Button
                title="Go to BMI"
                onPress={() =>
                    navigation.navigate('Profile', { name: 'BMI' })
                }
            />
        </View>
    );
};

export default HomeScreen;
const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: 'black',
        //marginTop: 50,
    },
    title: {
        fontSize: 20,
        fontWeight: 'bold',
    },
    separator: {
        marginVertical: 30,
        height: 1,
        width: '80%',
    },
});
